// src/pages/Login.js
import './style.css';
import React from 'react';

function Login() {
  return (
    <div className="container">
      <h2>Login</h2>
      <form>
        <label>Email:</label>
        <input type="email" required />
        <label>Password:</label>
        <input type="password" required />
        <button type="submit">Login</button>
      </form>
    </div>
  );
}

export default Login;
